import React, { useState } from 'react';
import { useDispatch } from 'react-redux';
import {  login } from '../SingupAction';
function Signin() {
    const dispatch = useDispatch();
    const [pacinetData, setPacinetData] = useState({
        email: "",
        password: "",
    });

    const onChange = (event) => {
        const { name, value } = event.target;
        setPacinetData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const onSubmit = (event) => {
        event.preventDefault();
        const newPacinet = {
          email: pacinetData.email,
          password: pacinetData.password,
        };
        dispatch(login(newPacinet));
        window.location.href='';
    };
    return (
      <div className="row">
          <div className="col-md-10 m-auto">
              <h1 className="text-center">Create Employee Form</h1>
              <hr />
              <form onSubmit={onSubmit}>
              
                  <input
                      type="text"
                      className={`form-control form-control-lg mt-4`}
                      placeholder="Employee address"
                      name="email"
                      value={pacinetData.email}
                      onChange={onChange}
                      required
                  />
                  <input
                      type="text"
                      className={`form-control form-control-lg mt-4`}
                      placeholder="Employee email"
                      name="password"
                      value={pacinetData.password}
                      onChange={onChange}
                      required
                  />
                  <input type="submit" className="btn btn-danger mt-4" value="Create Employee" />
              </form>
          </div>
      </div>
  ); 
} 

export default Signin;
